import React from 'react';

const Header = () => {
  return (
    <header className="header">
      <img src="/favicon.ico" alt="logo" />
      <h1 className="title">AI-Meditations</h1>
      <img src="/favicon.ico" alt="profile" />
    </header>
  );
};

export default Header;
